import React from 'react';

function LandingPage() {
  return (
    <h1> 
      PALZ
    <div>
      <button onClick={toggleMenu}>Menu</button>
      {isMenuOpen && (
        <div className="menu">
          <button onClick={() => navigate('/profile')}>Profile Page</button>
          // Other buttons
        </div>
      )}
    </div>
    </h1>
  );
}

export default LandingPage;
